import React from "react";
import "./CommentCard.scss";

class CommentCard extends React.Component {
  render() {
    return (
      <div className="commentSection">
        <div className="commentSection__icon"> </div>
        <div className="commentSection__container">
          <div className="commentSection__container--name">{this.props.data.name}</div>
          <div className="commentSection__container--date">{this.props.data.timestamp}</div>
        </div>
        <div>{this.props.data.comment}</div>
      </div>
    );
  }
}

export default CommentCard;
